import React from 'react';

export default function Categories() {
  const [activeIndex, setActiveIndex] = React.useState(0);
  const [categoriesItems, setCategoriesItems] = React.useState([
    { id: 1, title: 'Все', active: false },
    { id: 1, title: 'Мясные', active: false },
    { id: 1, title: 'Вегетарианская', active: false },
    { id: 1, title: 'Гриль', active: false },
    { id: 1, title: 'Острые', active: false },
    { id: 1, title: 'Закрытые', active: false },
  ]);

  return (
    <div className="categories">
      <ul>
        {categoriesItems.map((item) => (
          <li>{item.title}</li>
        ))}
      </ul>
    </div>
  );
}
